    /// 电子文档的控件填充信息。按照控件类型进行相应的填充。
    ///
    /// 当控件的 ComponentType='TEXT'时，FormField.ComponentValue填入文本内容
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "文本内容"
    /// }
    /// ```
    /// 当控件的 ComponentType='MULTI_LINE_TEXT'时，FormField.ComponentValue填入文本内容，支持自动换行。
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "多行文本内容"
    /// }
    /// ```
    /// 当控件的 ComponentType='CHECK_BOX'时，FormField.ComponentValue填入true或false文本
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "true"
    /// }
    /// ```
    /// 当控件的 ComponentType='FILL_IMAGE'时，FormField.ComponentValue填入图片的资源ID
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "yDwhsxxxxxxxxxxxxxxxxxxxxxxxxxxx"
    /// }
    /// ```
    /// 当控件的 ComponentType='ATTACHMENT'时，FormField.ComponentValue填入附件图片的资源ID列表，以逗号分隔，单个附件控件最多支持6个资源ID；
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "yDwhsxxxxxxxxxxxxxxxxxxxxxxxxxx1,yDwhsxxxxxxxxxxxxxxxxxxxxxxxxxx2,yDwhsxxxxxxxxxxxxxxxxxxxxxxxxxx3"
    /// }
    /// ```
    /// 当控件的 ComponentType='SELECTOR'时，FormField.ComponentValue填入选择的选项内容；
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "选择的内容"
    /// }
    /// ```
    /// 当控件的 ComponentType='DATE'时，FormField.ComponentValue填入日期内容；
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "2023年01月01日"
    /// }
    /// ```
    /// 当控件的 ComponentType='DISTRICT'时，FormField.ComponentValue填入省市区内容；
    /// ```
    /// FormFiled输入示例：
    /// {
    ///     "ComponentId": "componentId1",
    ///     "ComponentValue": "广东省深圳市福田区"
    /// }
    /// ```
    /// 【数据表格传参说明】
    /// 当控件的 ComponentType='DYNAMIC_TABLE'时，FormField.ComponentValue需要传递json格式的字符串参数，用于确定表头&填充数据表格（支持内容的单元格合并）
    /// 输入示例1：
    ///
    /// ```
    /// {
    ///     "headers":[
    ///         {
    ///             "content":"head1"
    ///         },
    ///         {
    ///             "content":"head2"
    ///         },
    ///         {
    ///             "content":"head3"
    ///         }
    ///     ],
    ///     "rowCount":3,
    ///     "body":{
    ///         "cells":[
    ///             {
    ///                 "rowStart":1,
    ///                 "rowEnd":1,
    ///                 "columnStart":1,
    ///                 "columnEnd":1,
    ///                 "content":"123"
    ///             },
    ///             {
    ///                 "rowStart":2,
    ///                 "rowEnd":3,
    ///                 "columnStart":1,
    ///                 "columnEnd":2,
    ///                 "content":"456"
    ///             },
    ///             {
    ///                 "rowStart":3,
    ///                 "rowEnd":3,
    ///                 "columnStart":3,
    ///                 "columnEnd":3,
    ///                 "content":"789"
    ///             }
    ///         ]
    ///     }
    /// }
    ///
    /// ```
    ///
    /// 输入示例2（表格表头宽度比例配置）：
    ///
    /// ```
    /// {
    ///     "headers":[
    ///         {
    ///             "content":"head1",
    ///             "widthPercent": 30
    ///         },
    ///         {
    ///             "content":"head2",
    ///             "widthPercent": 30
    ///         },
    ///         {
    ///             "content":"head3",
    ///             "widthPercent": 40
    ///         }
    ///     ],
    ///     "rowCount":3,
    ///     "body":{
    ///         "cells":[
    ///             {
    ///                 "rowStart":1,
    ///                 "rowEnd":1,
    ///                 "columnStart":1,
    ///                 "columnEnd":1,
    ///                 "content":"123"
    ///             },
    ///             {
    ///                 "rowStart":2,
    ///                 "rowEnd":3,
    ///                 "columnStart":1,
    ///                 "columnEnd":2,
    ///                 "content":"456"
    ///             },
    ///             {
    ///                 "rowStart":3,
    ///                 "rowEnd":3,
    ///                 "columnStart":3,
    ///                 "columnEnd":3,
    ///                 "content":"789"
    ///             }
    ///         ]
    ///     }
    /// }
    ///
    /// ```
    /// 表格参数说明
    ///
    /// | 名称                | 类型    | 描述                                              |
    /// | ------------------- | ------- | ------------------------------------------------- |
    /// | headers             | Array   | 表头：不超过10列，不支持单元格合并，字数不超过100 |
    /// | rowCount            | Integer | 表格内容最大行数                                  |
    /// | cells.N.rowStart    | Integer | 单元格坐标：行起始index                           |
    /// | cells.N.rowEnd      | Integer | 单元格坐标：行结束index                           |
    /// | cells.N.columnStart | Integer | 单元格坐标：列起始index                           |
    /// | cells.N.columnEnd   | Integer | 单元格坐标：列结束index                           |
    /// | cells.N.content     | String  | 单元格内容，字数不超过100                         |
    ///
    /// 表格参数headers说明
    /// widthPercent Integer 表头单元格列占总表头的比例，例如1：30表示 此列占表头的30%，不填写时列宽度平均拆分；例如2：总2列，某一列填写40，剩余列可以为空，按照60计算。；例如3：总3列，某一列填写30，剩余2列可以为空，分别为(100-30)/2=35
    /// content String 表头单元格内容，字数不超过100
    public struct FormField: TCInputModel, TCOutputModel {
        /// 控件填充vaule，ComponentType和传入值类型对应关系：
        /// TEXT - 文本内容
        /// MULTI_LINE_TEXT - 文本内容
        /// CHECK_BOX - true/false
        /// FILL_IMAGE、ATTACHMENT - 附件的FileId，需要通过UploadFiles接口上传获取
        /// SELECTOR - 选项值
        /// DYNAMIC_TABLE - 传入json格式的表格内容，具体见数据结构FlowInfo：https://cloud.tencent.com/document/api/1420/61525#FlowInfo
        public let componentValue: String

        /// 控件id，和ComponentName选择一项传入即可
        public let componentId: String?

        /// 控件名字，最大长度不超过30字符，和ComponentId选择一项传入即可
        public let componentName: String?

        public init(componentValue: String, componentId: String? = nil, componentName: String? = nil) {
            self.componentValue = componentValue
            self.componentId = componentId
            self.componentName = componentName
        }

        enum CodingKeys: String, CodingKey {
            case componentValue = "ComponentValue"
            case componentId = "ComponentId"
            case componentName = "ComponentName"
        }
    }

